import React from 'react';


function Landing() {
  return (
    <Provider>
    <Hero
      color="black"
      bg="white"
      backgroundImage="https://art.pixilart.com/adb150f032eb730.png"
    >
      <Heading>Cheat Checker</Heading>
      <Subhead>Prevent Stack Exchange Plagiarism</Subhead>
      <CallToAction href="/getting-started" mt={3}>
        For Students
      </CallToAction>
      <CallToAction href="/getting-started" mt={3}>
        For Instructors
      </CallToAction>
    </Hero>
  </Provider>
  );
}

export default Landing;
